import os
import sys

from setuptools import find_packages


def extract_module_name(file_path,package_abs_dir):
    if not package_abs_dir:
        relative_path = file_path
    else:
        relative_path = os.path.relpath(file_path, package_abs_dir)
    if file_path.endswith('__init__.py'):
        relative_path = os.path.dirname(relative_path)
    elif relative_path.endswith('.py'):
        relative_path = relative_path[:-3]
    return relative_path.replace(os.sep,'.')


def findPackageTreefromDir(all_file_list,package_abs_dir):
    packages_dict = {}
    for file in all_file_list:
        package_name = extract_module_name(file,package_abs_dir)
        if package_name:
            packages_dict[package_name] = file
    return packages_dict


